import {IMAGES} from './theme/resource/HResource';
import './App.css';
import './theme/colors.css';

function App() {
  return (
    <div className="App">
		<div className="HPageLayout">
			<div className="HTitleContainer">
			<p className="HTitle" >Comming Soon</p>
			</div>
			<div className="HBigLogoContainer">
				<img src={IMAGES.logoNtext} width="70%" height="100%" className="HBigLogo"/>
			</div> 
			<div className="HDesc">
				<p>IdentiFire provides a digital identity base KYC solution that verifies and validates your identity in the digital world using NFT on blockchain.
				</p>
			</div>
		</div>
		<div className="HContact">
				<p className="HPhone">phone: (972)-54-5299185</p>
				<a className="HLink" href="mailto:amir.schnabel@gmail.com">info@identi-fire.com</a>
		</div>
    </div>
  );
}

export default App;
